import React from 'react';
import { BrowserRouter, Routes, Route } from 'react-router-dom';
import './brand.css';

// Import Home02 components
import Home02 from './components/pages/Home02';

function App() {
  return (
    <BrowserRouter>
      <div className="App" id="top">
        <Routes>
          <Route path="/" element={<Home02 />} />
          <Route path="*" element={<Home02 />} />
        </Routes>
      </div>
    </BrowserRouter>
  );
}

export default App;
